import React, { useState } from "react";

const Travel = () => {
   const [travel, setTravel] = useState([
      {
         name: "Lucknow electronic bus",
         dis: "Words that best describe Pizza: Tasty: Satisfying: Versatile: Delicious: Crispy: Cheesy: Crave-worthy: Aromatic: Mouth-watering: Tempting: Comforting: Quick: ...",
         image: "https://khabarinfra.com/wp-content/uploads/2023/05/Electric-bus-696x418.jpg"
      },
      {
         name: "Prayagraj electronic bus",
         dis: "Words that best describe Pizza: Tasty: Satisfying: Versatile: Delicious: Crispy: Cheesy: Crave-worthy: Aromatic: Mouth-watering: Tempting: Comforting: Quick: ...",
         image: "https://s1.rdbuz.com/bo-images/IND/WM/25946/1777/SI/ML/webp/OXIJ09.webp"
      },
      {
         name: "Kanpur electronic bus",
         dis: "Words that best describe Pizza: Tasty: Satisfying: Versatile: Delicious: Crispy: Cheesy: Crave-worthy: Aromatic: Mouth-watering: Tempting: Comforting: Quick: ...",
         image: "https://www.opindia.com/wp-content/uploads/2024/09/ebus-scheme-unioncabinet.jpg"
      }
   ])
   return (
      <div className="mx-2 mx-md-5" style={{ marginTop: '100px' }} >

         {
            travel.map((data, index) => (
               <>
                  <div className="card mb-3">
                     <img src={`${data.image}`} className="card-img-top " alt="..." style={{ maxHeight: '400px' }} />
                     <div className="card-body">
                        <h5 className="card-title d-inline-block">Name :</h5>
                        <p className="card-text d-inline-block">
                           {data.name}       </p>
                        <h6></h6>
                        <h5 className="card-title">Discription: </h5>
                        <p className="card-text">
                           {data.dis}        </p>
                        <p className="card-text">
                           <small className="text-muted">Last updated 3 mins ago</small>
                        </p>
                     </div>
                  </div>
                  <hr />
               </>
            ))
         }
      </div>

   )
}
export default Travel;
